import { Box } from "@mui/material";
import MyTypography from "../../../components/MyTypography";

const footer = () =>{
    return(
        <Box sx={{padding:"16px 64px"}}>
            <MyTypography 
                text="Powered by" 
                size="18px"
                letterSpacing="6px"
                fontFamily="Raleway"
                margin="10px 0"
                fontWeight="400"
                opacity="0.5"
            />
        </Box>
    );
}

export default footer;
